message:
Главная тема сейчас — это военная операция на Украине, а также обстановка в южных регионах России.

В сети появляется много противоречивой и даже фейковой информации. Следить за ситуацией и получать только достоверные факты из регионов можно здесь: 

На границе:
@RostovInside - Ростов-на-Дону
@NovostiVLG - Волгоград
@IABelRu - Белгород
@News_Tracker - Ставрополь

🇺🇦🇷🇺 Общая сводка за последний час по ситуации с Россией и Украиной: 

— Байден готов ввести санкции против Путина лично; 
— Байден заявил, что «амбиции Путина не ограничиваются Украиной. Он хочет восстановить СССР»; 
— Байден заявил, что переговоров с Путиным не планирует; 
— Байден разрешил отправку дополнительных войск США в Германию; 
— США не будут участвовать в боях на Украине, об этом сообщил Байден; 
— Киев будет закрыт на въезд из-за комендантского часа (22:00 - 07:00), но открыт на выезд; 
— США вводят санкции против Сбера и ВТБ, сообщает Минфин США. В список санкций также вошли банки: Газпробанк, Открытие, Совкомбанк, Новикомбанка; 
— Акции Сбербанка падают более чем на 40% после новостей о санкциях; 
— Более 600 задержанных участников антивоенной акции в Москве, которая не была согласована.

СВЕЖАК
